script: |
  super -f text -I q11718.spq | sort > q11718.out

inputs:
  - name: q11718.spq
    data: |
      SELECT DISTINCT + + col0 + + 82 AS col1 FROM tab0 (FORMAT parquet) WHERE col2 + col2 NOT IN ( + col2 / 29 * col2 + 53, 11 * + + ( + col1 ), + 0, - col1, col0 * - 37 - - 52 * + col2, + 8 - - + col0 + + col2 + - - 92 );
  - name: tab0

outputs:
  - name: q11718.out
    data: |
      169
      179
      97
